import React from 'react';
import {Grid, Header} from 'semantic-ui-react';

function Login() {
    return <Grid textAlign='center' verticalAlign='middle' style={{height: '100vh' }}>
        <Grid.Column>
            <Header>Login into Your Account:</Header>
        </Grid.Column>
    </Grid>;
    }

export default Login;
